// Navbar.js
import React from 'react';
import { Link, useLocation } from 'react-router-dom';

const Navbar = () => {
  const location = useLocation();

  const getLinkClassName = (pathname) => {
    return location.pathname === pathname ? 'active' : '';
  };

  return (
    <nav>
      <ul>
        <li style={{ color: location.pathname === '/' ? '#ff0000' : 'initial' }}>
  <Link to="/">Inicio</Link>
</li>

        <li className={getLinkClassName('/pagina1')}>
          <Link to="/pagina1">Página 1</Link>
        </li>
        <li className={getLinkClassName('/pagina2')}>
          <Link to="/pagina2">Página 2</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
